import React from "react";
import CardAddOrderStyle from "./CardAddOrderStyle"



class CardAddOrder extends React.PureComponent {
    constructor(props) {
        super(props);
        this.state = {
          error: null,
          isLoaded: false,
        };
      }



      render() {
        return (
            <CardAddOrderStyle>
                <div style={{boxShadow: "rgba(0, 0, 0, 0.2) 0px 3px 5px -1px, rgba(0, 0, 0, 0.14) 0px 6px 10px 0px, rgba(0, 0, 0, 0.12) 0px 1px 14px 0px"}}>
                    <h1>Title</h1>
                </div>
                <div>
                  <div>
                      <div>
                          <p>50</p>
                      </div>
                      <div>

                      </div>
                      <div>
                          Количество
                      </div>
                  </div>
                  <div>+</div>
                </div>
            </CardAddOrderStyle>
        )
      }
}


export default CardAddOrder;
